--
-- Disparadores `compras`
--
DELIMITER $$
CREATE TRIGGER `actualizar_inventario` AFTER INSERT ON `compras` FOR EACH ROW BEGIN
SET @cant = (SELECT cantidad from inventario where id_producto=NEW.id_producto);
update inventario set cantidad=(@Cant - NEW.cantidad) where id_producto=NEW.id_producto;
END
$$
DELIMITER ;
DELIMITER $$
CREATE TRIGGER `actualizar_precio` BEFORE INSERT ON `compras` FOR EACH ROW BEGIN
SET @Precio = (SELECT precio_venta FROM inventario WHERE id_producto=NEW.id_producto);
SET NEW.precio = (NEW.cantidad * @Precio);
END
$$
DELIMITER ;
DELIMITER $$
CREATE TRIGGER `devolver_al_inventario` AFTER DELETE ON `compras` FOR EACH ROW BEGIN
SET @Cant = (SELECT cantidad FROM inventario WHERE id_producto=OLD.id_producto);
SET @NEWCant = (@Cant + OLD.cantidad);
update inventario set cantidad=@NEWCant WHERE id_producto=OLD.id_producto;
END
$$
DELIMITER ;

